import React, { Component } from 'react';
import { getBiggerThumbnailUrl } from '../../helpers/tools'

class Card extends Component {
    render() {
        return (
            <div className="Card">
                <image src="{ getBiggerThumbnailUrl(this.props.model.thumbnails) }" alt="Model main photo"></image>
                <p>{ this.props.model.name }</p>
            </div>
        );
    }
}

export default Card;
